// src/features/profile/LendingTermsEditor.jsx
import React, { useEffect, useState } from 'react';

const AMOUNTS = ['50', '100', '150', '200', '250'];

function clampRate(v) {
  const n = Number(v);
  if (!Number.isFinite(n)) return 0;
  if (n < 0) return 0;
  if (n > 100) return 100;
  return Math.round(n * 100) / 100;
}

export default function LendingTermsEditor() {
  const [loading, setLoading] = useState(true);
  const [saving, setSaving] = useState(false);
  const [err, setErr] = useState('');
  const [ok, setOk] = useState('');
  const [terms, setTerms] = useState(() =>
    Object.fromEntries(AMOUNTS.map(a => [a, { enabled: false, rate: 0 }]))
  );

  useEffect(() => {
    let alive = true;
    (async () => {
      try {
        setLoading(true);
        setErr('');
        const r = await fetch('/api/users/me/lending-terms', {
          headers: { Authorization: `Bearer ${localStorage.getItem('token')}` },
        });
        if (!r.ok) throw new Error(await r.text());
        const d = await r.json();
        if (alive) setTerms(d.lendingTerms || {});
      } catch (e) {
        if (alive) setErr('Failed to load lending terms.');
        console.error(e);
      } finally {
        if (alive) setLoading(false);
      }
    })();
    return () => { alive = false; };
  }, []);

  function toggleAmount(a) {
    setTerms(t => ({ ...t, [a]: { ...t[a], enabled: !t[a].enabled } }));
  }
  function changeRate(a, v) {
    setTerms(t => ({ ...t, [a]: { ...t[a], rate: clampRate(v) } }));
  }

  async function save() {
    try {
      setSaving(true);
      setErr('');
      setOk('');
      const r = await fetch('/api/users/me/lending-terms', {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `Bearer ${localStorage.getItem('token')}`,
        },
        body: JSON.stringify({ lendingTerms: terms }),
      });
      if (!r.ok) throw new Error(await r.text());
      setOk('Lending terms saved.');
    } catch (e) {
      console.error(e);
      setErr('Failed to save lending terms.');
    } finally {
      setSaving(false);
    }
  }

  if (loading) {
    return <div className="lt-card">Loading lending terms…</div>;
  }

  return (
    <div className="lt-card">
      <div className="lt-title">Lending Terms</div>
      <p className="lt-sub">
        Choose which preset amounts you’re willing to fund and the APR you’ll charge.
      </p>

      {err && <div className="lt-alert lt-alert--err">{err}</div>}
      {ok && <div className="lt-alert lt-alert--ok">{ok}</div>}

      <div className="lt-grid">
        {AMOUNTS.map(a => (
          <div className="lt-row" key={a}>
            <label className="lt-toggle">
              <input
                type="checkbox"
                checked={!!terms[a]?.enabled}
                onChange={() => toggleAmount(a)}
              />
              <span>${a}</span>
            </label>

            <div className="lt-rate">
              <input
                type="number"
                min="0"
                max="100"
                step="0.25"
                value={terms[a]?.rate ?? 0}
                onChange={e => changeRate(a, e.target.value)}
                disabled={!terms[a]?.enabled}
              />
              <span className="lt-rate-suffix">% APR</span>
            </div>
          </div>
        ))}
      </div>

      <div className="lt-actions">
        <button className="action-btn primary" onClick={save} disabled={saving}>
          {saving ? 'Saving…' : 'Save Terms'}
        </button>
      </div>
    </div>
  );
}
